import React from 'react';
import {homeObjOne} from './Data';
import Bio from '../../Bio';
import Welcome from '../../Welcome';

function About() {
    return (
        <>
            <Welcome {...homeObjOne} />
            <Bio {...bioObjOne} />
        </>
    );
}

export default About;
